function App() {
  return (
  <BrowserRouter>
  <Navbar />
    <Routes>
        <Route path="/allorders" element={<AllOrders />} />
        <Route path="/signin" element={<SignIn />} />
        <Route path="/signup" element={<Signup />} />
    </Routes>
  </BrowserRouter>      
  );
}

export default App;
